import { useState } from 'react';

const Form = ({ addTodo }) => {
  const [val, setVal] = useState('');
  const add = val => {
    addTodo(val);
  };
  return (
    <>
      <input type='text' value={val} onChange={e => setVal(e.target.value)} />
      <button onClick={() => add(val)}>追加</button>
    </>
  );
};

export default Form;
